import React from 'react'
import { useState } from 'react';
import {set, useForm} from 'react-hook-form'
import './AddressForm.css'
import TrendingFlatIcon from '@mui/icons-material/TrendingFlat';

import { useDispatch } from 'react-redux';
import { setAddress } from '../../Store/UserInfo/addressSlice';
const AddressForm = ({onTabSwitch}) => {
  const [deliveryType, setDeliveryType] = useState('Home Delivery');
  const [addressInputsDisabled, setAddressInputsDisabled] = useState(false);
  const handleDeliveryTypeChange = (event) => {
    const { value } = event.target;
    setDeliveryType(value);
    setAddressInputsDisabled(value === 'takaway');
  };
    const {register,handleSubmit} = useForm()
    const dispatch = useDispatch()
    const onSubmit =(data)=>{
      const addressData = {
        ...data,
        deliveryType: deliveryType
      };
        dispatch(setAddress(addressData))
        onTabSwitch('Payment')
    }

  return (
    <form className='address' onSubmit={handleSubmit(onSubmit)}>
         <p>Please select your favorite Web language:</p>
        <div class="one">
          <input type="radio" id="take" name="address" value="takaway"
            checked={deliveryType === 'takaway'}
            onChange={handleDeliveryTypeChange}
             className='seclector'/>
          <label for="takeaway">Take Away</label>
          </div>
          <div className='two'>
          <input type="radio" id="take1" name="address" value="Home Delivery"
              checked={deliveryType === 'Home Delivery'}
              onChange={handleDeliveryTypeChange}/>
          <label for="HomeDelivery">Home Delivery</label>
          <h3 className='h-address'>Address for Delivery</h3>


        </div>
        <div className='address-main'>
          <div className='add'>
            <label className='l-address' for="streetAddress">Street Address</label>
            <input 
                 {...register('street')}
                 className='seclector'
                 id="street address"
                 type="text"
                 disabled={addressInputsDisabled}
                 placeholder='Street Address'/>
          </div>
          <div className='add'>
            <label className='l-address' for="DoorNO"> Door No</label>
            <input 
                 {...register('Door')}
                 className='seclector'
                 id="Door address"
                 type="text"
                 disabled={addressInputsDisabled}
                 placeholder='Door Number'/>
          </div>
          <div className='add'>
            <label className='l-address' for="city">City</label>
            <input 
                 {...register('City')}
                 className='seclector'
                 id="City"
                 type="text"
                 disabled={addressInputsDisabled}
                 placeholder='City'/>
          </div>
          <div className='add'>
            <label className='l-address' for="city">Mobile no</label>
            <input 
                 {...register('Mobile')}
                 className='seclector'
                 id="Mobile"
                 type="phone"
                 disabled={addressInputsDisabled}
                 placeholder='+91 moblie number'/>
          </div>
          <div className='add'>
            <label className='l-address' for="pincode">Pin Code</label>
            <input 
                 {...register('Pin')}
                 className='seclector'
                 id="Pincode"
                 type="number"
                 disabled={addressInputsDisabled}
                 placeholder='Pin Code'/>
          </div>
         
        </div>

            <div className='b-address'>
                <button className='button' type="submit">NEXT</button>

            </div>
      

    </form>
  )
}

export default AddressForm
